        /**
         * Signature optimization (glue)
         * @param $sigs
         */
        private function optSig(&$sigs)
        {

            $sigs = array_unique($sigs);
            $fix = [
                '*click\.*\.xyz' => '.*click\.*\.xyz'
            ];
            foreach ($sigs as $index => &$s) {
               $s = str_replace(array_keys($fix), array_values($fix), $s);
            }
            unset($s);

            // Add SigId
            foreach ($sigs as $index => &$s) {
                $s .= '(?<X' . $index . '>)';
            }
            unset($s);
            #print_r($sigs); die;


            $fix = [
                '([^\?\s])\({0,1}\.[\+\*]\){0,1}\2[a-z]*e'  => '(?J)\.[+*](?<=(?<d>[^\?\s])\(..|(?<d>[^\?\s])..)\)?\g{d}[a-z]*e',
                'http://.+?/.+?\.php\?a'                    => 'http://[^?\s]++(?<=\.php)\?a',
                '\s*[\'"]{0,1}.+?[\'"]{0,1}\s*'             => '.+?',
                '[\'"]{0,1}.+?[\'"]{0,1}'                   => '.+?',
                
            ];

            $sigs = str_replace(array_keys($fix), array_values($fix), $sigs);
            
            $fix = [
                '~^\\\\[d]\+&@~'                            => '&@(?<=\d..)',
                '~^((\[\'"\]|\\\\s|@)(\{0,1\}\.?|[?*]))+~'  => ''
            ];

            $sigs = preg_replace(array_keys($fix), array_values($fix), $sigs);

            $this->optSigCheck($sigs);
          
            $tmp = [];
            foreach ($sigs as $i => $s) {
                if (!preg_match('~^(?>(?!\.[*+]|\\\\\d)(?:\\\\.|\[.+?\]|.))+$~', $s)) {
                    unset($sigs[$i]);
                    $tmp[] = $s;
                }
            }
            
            usort($sigs, 'strcasecmp');
            $txt = implode("\n", $sigs);

            for ($i = 24; $i >= 1; ($i > 4) ? $i -= 4 : --$i) {
                $txt = preg_replace_callback('#^((?>(?:\\\\.|\\[.+?\\]|[^(\n]|\((?:\\\\.|[^)(\n])++\))(?:[*?+]\+?|\{\d+(?:,\d*)?\}[+?]?|)){' . $i . ',})[^\n]*+(?:\\n\\1(?![{?*+]).+)+#im', [$this, 'optMergePrefixes'], $txt);
            }

            $sigs = array_merge(explode("\n", $txt), $tmp);
            
            $this->optSigCheck($sigs);

        }

        /**
         * @param $m
         * @return string
         */
        private function optMergePrefixes($m)
        {
            $limit = 8000;

            $prefix     = $m[1];
            $prefix_len = strlen($prefix);

            $len = $prefix_len;
            $r   = [];

            $suffixes = [];
            foreach (explode("\n", $m[0]) as $line) {

                if (strlen($line) > $limit) {
                    $r[] = $line;
                    continue;
                }

                $s = substr($line, $prefix_len);
                $len += strlen($s);
                if ($len > $limit) {
                    if (count($suffixes) == 1) {
                        $r[] = $prefix . $suffixes[0];
                    } else {
                        $r[] = $prefix . '(?:' . implode('|', $suffixes) . ')';
                    }
                    $suffixes = [];
                    $len      = $prefix_len + strlen($s);
                }
                $suffixes[] = $s;
            }

            if (!empty($suffixes)) {
                if (count($suffixes) == 1) {
                    $r[] = $prefix . $suffixes[0];
                } else {
                    $r[] = $prefix . '(?:' . implode('|', $suffixes) . ')';
                }
            }

            return implode("\n", $r);
        }

        /*
        * Checking errors in pattern
        */
        private function optSigCheck(&$sigs)
        {
            $result = true;

            foreach ($sigs as $k => $sig) {
                if (trim($sig) == "") {
                    unset($sigs[$k]);
                    $result = false;
                }

                #$sig = 'click\.*\.xyz(?<X1807>)';
                if (@preg_match('~' . $sig . '~i', '') === false) {
                    $error = error_get_last();
                    unset($sigs[$k]);
                    $result = false;
                }
            }

            return $result;
        }

