                public static function isOwnUrl($url, $own_domain)
                {
                    if ($own_domain === null || $own_domain === '') {
                        return false;
                    }
                    return (bool)preg_match('~^(http(s)?:)?//(www\.)?' . preg_quote($own_domain, '~') . '~msi', $url);
                }

                public static function isUrlInList($url, $list)
                {

                    if (isset($list)) {
                        foreach ($list as $item) {
                            if (preg_match('~' . $item . '~msiS', $url, $id, PREG_OFFSET_CAPTURE)) {

                                
                                return $id;
                            }
                        }
                    }

                    return false;
                }

                public static function UrlChecker($l_Content, &$l_Pos, &$l_SigId, $signs, $debug = null)
                {
                    $l_Pos      = [];
                    $l_SigId    = [];
                    $offset     = 0;

                    while (preg_match(self::URL_GRAB, $l_Content, $l_Found, PREG_OFFSET_CAPTURE, $offset)) {
                        $l_Found[2][0] = str_replace('\/', '/', $l_Found[2][0]);
                        if (!self::isOwnUrl($l_Found[2][0], $signs->getOwnUrl()[1])
                            && (isset($signs->whiteUrls) && !self::isUrlInList($l_Found[2][0], $signs->whiteUrls->getDb()))
                        ) {
                            if ($id = self::isUrlInList($l_Found[2][0], $signs->blackUrls->getDb())) {
                                if (isset($l_Found[1][0]) && $l_Found[1][0] !== '' && isset($l_Found[3][0]) && $l_Found[3][0] !== '') {
                                    $l_Pos['black'][] = $l_Found[2][1];
                                    $l_SigId['black'][] = $signs->blackUrls->getSig($id);
                                }
                            } else {
                                $l_Pos['unk'][] = $l_Found[2][1];
                                $l_SigId['unk'][] = $l_Found[2][0];
                            }
                        }
                        $offset = $l_Found[2][1] + strlen($l_Found[2][0]);
                    }
                    return !empty($l_Pos);
                }

                public static function scan_vdie($scanfile, $content) {
                    global $SIGN_PARTERN, $CONST_CLASS_RESULT;
                    list($ext, $flag)  = [$scanfile[3], $scanfile[7]];
                    if ( !( $flag & ScanItem::FILE) )
                        return [0, []];
                        
                    #$content = file_get_contents('./malwares_samples/vdie-dream-killer.php');
                    foreach ( $SIGN_PARTERN->_VirusDieSig->signs as $pattern => $value) {
                        if ( $value[0] !== null && ! in_array($ext, (array) $value[0])   )
                            continue;

                        if ( $pattern[0] === "=" ) {
                            if ( stripos($content, substr($pattern, 1)) === false  ) {
                                continue;
                            }
                            $signid = $SIGN_PARTERN->_VirusDieSig->def[hexdec($value[1])];
                            return [ 1,  array_merge( [ $CONST_CLASS_RESULT->MALWARE,  $signid  , time() ] ,  $scanfile, ['CriticalFILE'] ) ];
                        }
                        else if (  $pattern[0] === ":" ) {
                            continue;
                        }
                        else if ( in_array($pattern[0], ['/', '#', '~']) ) {
                            error_clear_last();
                            $mf = @preg_match($pattern, $content, $match, PREG_OFFSET_CAPTURE);
                            $err = preg_last_error();
                            if ( $mf === false || 0 !== $err || !$mf) {
                                continue;
                            }
                            $signid = $SIGN_PARTERN->_VirusDieSig->def[hexdec($value[1])];
                            return [1, array_merge([$CONST_CLASS_RESULT->MALWARE,  $signid  , time()] ,  $scanfile, ['CriticalFILE'] ) ];
                        }
                    }                        
                    
                    return [0, []];

                }
                public static function scan_extended($scanfile, $content) {
                    global $SIGN_PARTERN, $CONST_CLASS_RESULT;
                    
                    foreach ( $SIGN_PARTERN->_ExtendedSig as $key => $pattern) {
                        $regexPattern = '#' . $pattern . '#smiS';
                        $checkDefinitions = function ($match) use ($key, $regexPattern, &$patternFound) {
                           
                            if (!empty($lastMatch)) {
                                $descriptionPrefix = 'Signature';
                                $description = 'Malware Signature (hash: ' . $key . ')';
                                $patternFound[$patternFoundKey] = [
                                    'type' => $type,
                                    'key' => $key,
                                    'level' => CodeMatch::DANGEROUS,
                                    'output' => CodeMatch::getText($descriptionPrefix, $key, $description, $lastMatch, $lineNumber),
                                    'description' => $description,
                                    'line' => $lineNumber,
                                    'pattern' => $regexPattern,
                                    'match' => $lastMatch,
                                ];
                            }
                        };


                        if (@preg_match_all($regexPattern, $content, $matches, PREG_OFFSET_CAPTURE)) {
                            foreach($matches as $mkey=>$match) {
                                if ( substr((string)$mkey, 0,1) == "X" && $match[0] && $match[0][1] >0) 
                                return [ 1,  array_merge( [ $CONST_CLASS_RESULT->MALWARE,  "MAL:RX:DNG:" . substr((string)$mkey,1)  , time() ] ,  $scanfile, ['CriticalFILE'] ) ];
                            }
                        }
                    }
                    return [0, []];
                }

                public static function scan_exploits($scanfile, $content) {
                    global $SIGN_PARTERN, $CONST_CLASS_RESULT;

                    $exploits = $GLOBALS['OPTIONS']['EXPLOITS'];
                    if ( $exploits === false )
                        return [0, []];

                    foreach ( $SIGN_PARTERN->_ExploitsSig as $key => $pattern) {
                        $sign_key =  join("_", explode(":", strtolower(substr(substr($key, 4), 0, -2))));
                        if ( !($exploits === true || in_array($sign_key, $exploits) ))
                            continue;

                        // Check exploits
                        if (@preg_match_all($pattern, $content, $matches, PREG_OFFSET_CAPTURE)) {
                            return [ 1,  array_merge( [ $CONST_CLASS_RESULT->EXPLOITS | $CONST_CLASS_RESULT->OpenListing,  $key , time() ] ,  $scanfile) ];
                        }
                        
                    }

                    return [0, []];

                }

            }

