                        return [ 1,  array_merge( [ $CONST_CLASS_RESULT->CRITICAL | $CONST_CLASS_RESULT->WebpageError,   "CTR:WPAGE:GBOT:" . (string)$bot_code  , time() ] ,  $scanfile), [] ];
