                    list($detected, $result) = $gBlackAndWhiteURLs->scan($bot_data, $scanfile, 'GBOT');
                    #print_r([$detected, $result]); die;
                    if ($detected){
                        unset($data, $bot_data);
                        return [$detected, $result, []];
                    }

                    $l_botbody = strlen($bot_data) ;
                    $l_livebody = strlen($data) ;
                    $diff = 0;
                    if ( $l_botbody > $l_livebody )
