                    $ret_files[]= [ substr($sdir,  strlen($scan_path)), $hashfile, $size,  $ext , $perms, $mtime, "{$group_name}:{$user_name}" , $flag | ScanItem::VULNERABLE | ScanItem::FILE ];;
                    continue;
