        $scan_fdr = dirname($fdir );
        #$scan_fdr = "./malwares_samples/0777fdlders";
        list($ext, $perms, $mtime, $size, $ownerid, $hashfile , $user_name, $group_name, $flag) = $GLOBALS['fn:filestats']($scan_fdr); 
